  false,\n\t\"url\": null,\n\t\"notes\": \"These statements report the results of
  Government operations, which include the results of operations for earmarked funds.
  They include non-exchange revenues that are generated principally by the Government's
  sovereign power to tax, levy duties, and assess fines and penalties. These statements
  also present the cost of Government operations, net of revenue earned from the sale
  of goods and services to the public (exchange revenue). They further include certain
  adjustments and unreconciled transactions that affect the net position.\",\n\t\"license_title\":
